import React,{useState} from 'react';
import ReactDOM from 'react-dom';

const New = () =>{

  const handleSubmit =(e)=>{
    e.preventDefault();
    console.log('You clicked submit.');
  }
  return(
    <div className="center">
      <h1>Meetup Form</h1>
      <form>
      <label>
       Meetup Name:
        <input className="one" type="text" /><br />
       Meetup Desigination:
        <input  className="two" type="text" /><br />
       Meetup Organization:
        <input  className="three" type="text" /><br />
       Meetup Contact.No:
        <input  className="four" type="text" /><br />
       Meetup Date:
        <input  className="five" type="date" /><br />
       Meetup Address:
        <input  className="six" type="text" /><br />
      </label>
     <button className="button"  onSubmit={handleSubmit}> Sumbit</button>
      </form>
    </div>
  )
}

export default New;
